import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <nav
            style={{
                display: 'flex',

                alignItems: 'center',
                padding: '1rem',
                backgroundColor: 'blue',
                color: 'white',
                fontFamily: 'Arial, sans-serif',
            }}
        >
            <Link to='/' style={{ textDecoration: 'none', color: 'white', fontSize: '1.2rem' }}>
                Home
            </Link>
            <Link to='/Game' style={{ textDecoration: 'none', color: 'white', fontSize: '1.2rem' }}>
                Game
            </Link>
        </nav>
    );
}

export default Navbar;
